         //    {
         //        text: 'Share h��ks with the bretheren',
         //        isComplete: false
         //    },
         //    {
         //        text: 'Ask br�ther if you may have h��k',
         //        isComplete: false
         //    }
         //]);

         const addTodo = (text: string) => {
            // const newTodos = [{ text }, ...todos];
           //  setTodos(newTodos);
             getTodos();
         };

         const handleInputChange = (e: { currentTarget: { value: React.SetStateAction<string>; }; }) => {
             setInputValue(e.currentTarget.value);
         }

         const handleComplete = (e: { currentTarget: { getAttribute: (arg0: string) => any; }; }) => {
             console.log("handleComplete");
             const index = e.currentTarget.getAttribute("data-index");
             const newTodos = [...todos];
             newTodos[index].completed = !newTodos[index].completed;
             setTodos(newTodos);
         };

         const handleRemove = (e: { stopPropagation: () => void; currentTarget: { getAttribute: (arg0: string) => any; }; }) => {
             e.stopPropagation();
             const index = e.currentTarget.getAttribute("data-index");
             const newTodos = [...todos];
             newTodos.splice(index, 1);
             setTodos(newTodos);
         };

         const handleSubmit = (e: { preventDefault: () => void; }) => {
             e.preventDefault();
             if (!inputValue) return;
             addTodo(inputValue);
             setInputValue('');
         };

    return (
        <div className="contain">
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    value={inputValue}
                    onChange={handleInputChange}
                />
            </form>
            <ul>
                {todos.map(({ text, completed }, i) => (
                    <li
                        aria-role="button"
                        className={completed ? 'complete' : ""}
                        data-index={i}
                        onClick={handleComplete}
                        onKeyPress={accessibleClick(this)}
                    >
                        <div>{text}</div>
                        <button
                            aria-label={`remove todo ${i}`}
                            className="remove"
                            data-index={i}
                            onClick={handleRemove}
                        />
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default App;
